import React from "react";
import emojipedia from "../emojipedia";

function createEntry(entryItem) {
	return <Entry key={entryItem.id} emoji={entryItem.emoji} name={entryItem.name} meaning={entryItem.meaning} />;
}

function App() {
	return (
		<div>
			<h1>
				<span>emojipedia</span>
			</h1>
			<dl className="dictionary">{contacts.map(createEntry)}</dl>
		</div>
	);
}

export default App;
